import React from 'react'
//import { Typography,Box,Container } from '@material-ui/core'
import { Typography,Container,Box } from '@mui/material'
import SearchBar from './components/search/SearchBar'


const App = () => {
  return (
    <Container maxWidth='md' sx={{background: 'linear-gradient(rgba(111,105,105,1), rgba(76,75,75,0.5))', width:'808px',height:'480px'}} >

      <SearchBar />
      <Box sx={{background: 'linear-gradient(rgba(196,196,196,0), rgba(207,207,207,1))',borderRadius:'30px'}}>

      </Box>

    </Container>


  )
}

export default App
